import React from "react"

function Profile(props) {
    console.log(props)
    return (
        <div>
            {props.x.map((el) => (
                <h1>{el.name}</h1>
            ))}
            <h1>{props.y.name}</h1>
        </div>
    );
}
export default Profile;
